import React from 'react';
import { connect } from 'react-redux';
import LoginForm from './loginForm';
import { singUp } from '../actions';

const SingUp = props => {
    return (
        <div>
            <h3>Sign Up</h3>
            <LoginForm onSubmit={props.singUp} labelButton="Sing Up"></LoginForm>
        </div>
    );
}

export default connect(null, { singUp })(SingUp);
